import React from 'react'
import image2 from '../assets/images/h1-slide-1.jpg';
function Home() {
    return (
        <section>
            <img src={image2} alt="" />
            <div className="max-width">
                
                <div className="container">
                    
                </div>
            </div>
        </section>
    )
}

export default Home;
